package edu.kh.mind.board.model.vo;

import java.io.File;

public class Image {

	private int imageNo;
	private String imagePath;
	private String imagePathName;
	private String imageOriginal;
	private int imageLevel;
	private int memberNo;
	private int boardNo;
	private int professionNo;
	
	public Image() {
		// TODO Auto-generated constructor stub
	}

	public int getImageNo() {
		return imageNo;
	}

	public void setImageNo(int imageNo) {
		this.imageNo = imageNo;
	}

	public String getImagePath() {
		return imagePath;
	}

	public void setImagePath(String imagePath) {
		this.imagePath = imagePath;
	}

	public String getImagePathName() {
		return imagePathName;
	}

	public void setImagePathName(String imagePathName) {
		this.imagePathName = imagePathName;
	}

	public String getImageOriginal() {
		return imageOriginal;
	}

	public void setImageOriginal(String imageOriginal) {
		this.imageOriginal = imageOriginal;
	}

	public int getImageLevel() {
		return imageLevel;
	}

	public void setImageLevel(int imageLevel) {
		this.imageLevel = imageLevel;
	}

	public int getMemberNo() {
		return memberNo;
	}

	public void setMemberNo(int memberNo) {
		this.memberNo = memberNo;
	}

	public int getBoardNo() {
		return boardNo;
	}

	public void setBoardNo(int boardNo) {
		this.boardNo = boardNo;
	}

	public int getProfessionNo() {
		return professionNo;
	}

	public void setProfessionNo(int professionNo) {
		this.professionNo = professionNo;
	}


	
}
